import Header from "./components/header/header";

function App() {
  const style = {
    width: 'auto',
    height: '30px',
    border: '1px black solid'
  }
  return (
    <div className="App">
      <Header></Header>
      <div style={style}></div>
    </div>
  );
}

export default App;
